Scene 2. Bionca, Mike Horner
Scene 3. Jacqueline, Shanna McCullough
Scene 4. Tracey Adams, Randy Spears
Scene 5. Lynn LeMay, Jon Dough
Scene 6. Lynn LeMay, Mike Horner

